		P.a((12-1)/26,(12-1)%26) = q1r_3_1*(2*q1q_1_1*t_1 + 2*q1q_2_1*t_2) - 2*q1q_1_1*q1r_1_1*t_3 - 2*q1q_2_1*q1r_2_1*t_3;
