		P.a((14-1)/26,(14-1)%26) = 2*q1q_2_1*q1r_1_1*t_3 - 2*q1q_2_1*q1r_3_1*t_1;
		P.a((15-1)/26,(15-1)%26) = 2*q1q_3_1*q1r_2_1*t_1 - 2*q1q_3_1*q1r_1_1*t_2;
		P.a((16-1)/26,(16-1)%26) = q1r_3_1*(q1q_1_1*t_2 - q1q_2_1*t_1) - q1r_2_1*(q1q_1_1*t_3 - q1q_3_1*t_1) + q1r_1_1*(q1q_2_1*t_3 - q1q_3_1*t_2);
